import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { ThemeProvider } from '@material-ui/styles';
import { ReactComponent as FUBULogoSmall } from '../../assets/fubu_logo_small.svg';
import Grid from '@material-ui/core/Grid';
import theme from '../../theme';
import { Typography } from '@material-ui/core';


const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
        justifyContent: 'center',
        backgroundColor: '#E5E7EE',
        width: '234px',
        height: '1024px',
    },
    logo: {
        paddingTop: theme.spacing(14),
        paddingBottom: theme.spacing(6),
        textAlign: 'center',
        marginLeft: 'auto',
        marginRight: 'auto',
        display: 'block',
    },
        text: {
            marginTop: '10px',
            marginBottom: '50px',
            textAlign: 'center',
        }
    }));



function Sidebar() {
    const classes = useStyles();

    return (
        <ThemeProvider theme={theme}>
            <Grid container className={classes.root} >
                <Grid item xs={6}>
                    <Grid item xs={12}>
                        <FUBULogoSmall className={classes.logo}></FUBULogoSmall>
                    </Grid>
                    <Grid className={classes.text} item xs={12}>
                        <Typography variant="p"> Hi (name we store here)! Are you:</Typography>
                    </Grid>
                </Grid>
            </Grid>
        </ThemeProvider>

    );
}

export default Sidebar;
